description:
Martires del Compas - Flamenco Billy
1995

Brought to you by WWTFSMD?

The title of this record has ended up becoming the name for the Martires del Compas' distinctive sound. &quot;Flamenco Billy&quot; is not just an expression, it is also a way of seeing flamenco and of understanding street life. Its fusion and lyrics, full of everyday images and of particular characters, mark their own unique and umistakeable style.
-- esflamenco.com

